import React, { useEffect, useState } from "react";

function Editor(props) {
  return (
    <div id="controls">
      <label htmlFor="grayscale">
        <input
          name="grayscale"
          type="range"
          min="0"
          max="1"
          step="0.01"
          value={props.gray}
          onChange={(e) => {
            props.updGray(e.target.value);
          }}
        />
        grayscale
      </label>
      <br />
      <label htmlFor="sepia">
        sepia
        <input
          name="sepia"
          type="range"
          min="0"
          max="1"
          step="0.01"
          value={props.sepia}
          onChange={(e) => {
            props.updSepia(e.target.value);
          }}
        />
      </label>
      <br />
      <label htmlFor="hue">
        hue
        <input
          name="hue"
          type="range"
          min="0"
          max="360"
          step="1"
          value={props.hue}
          onChange={(e) => {
            props.updHue(e.target.value);
          }}
        />
      </label>
    </div>
  );
}

export default Editor;
